  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Arrowwood
  Water Management District outlines District accomplishments during the 1978 calendar
  year. The report begins by summarizing the weather conditions and water conditions
  during the year. Wildlife- including migratory birds, upland game birds, big game
  animals,  and raptors- is also covered. The District development and maintenance
  section discusses physical developments and prescribed burns. Resource management
  is outlined; topics include grazing and haying. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  discusses hunting. Items of interest and photographs are attached.\",\n\t\"license_title\":
